import './App.css';
import DiaryEditor from './DiaryEditor';
import DiaryList from './DiaryList';

const dummyList = [
  {
    id: 1,
    author: '양하린',
    content: '샐러드',
    exercise: 2,
    created_date: new Date(),
  },
];

function App() {
  return (
    <div className='App'>
      <DiaryEditor />
      <DiaryList />
    </div>
  );
}

export default App;
